import React from 'react';
// ///////////////////////////////
import '../sass/pages/appSection.styles.scss';
// import '../sass/base/utilities';
// import '../sass/base/utilities';
import  img from'../img/phone.png';

class AppSection extends React.Component{
    constructor(){
        super()
        this.state={

        }
    }
    render(){
        return(
            <div className='appSection margin-top-medium'>
                <img className='appSection__img' src={img} alt='phone'/>
                <div>
                    <h3>حامی کوک بر روی موبایل</h3>
                    <p className='appSection__text'>برای دریافت لینک دانلود اپلیکیشن حامی کوک شماره موبایل خود را  وارد کنید.</p>
                    <div className='appSection__group'>
                        <input type='text' className='appSection__group-input margin-top-medium' />
                        <button className='appSection__group-btn'>دریافت لینک با استفاده از sms</button>
                    </div>
                </div>
            </div>
        )
    }
};

export default AppSection;
